import React from "react";
import styles from "./SearchBox.module.css"
import ProductContainer from "../Product/ProductContainer";

const SearchBox = ({Search,apple,xiaomi}) => {

    let AppleElementSearch = apple.filter(f => f.name.toLowerCase().includes(Search)).map(ae => <ProductContainer
        key={ae.id} {...ae}/>)


    let XiaomiElementSearch = xiaomi.filter(f => f.name.toLowerCase().includes(Search)).map(ae => <ProductContainer
        key={ae.id} {...ae}/>)

    return <div className={styles.searchBox}>
        {AppleElementSearch}
        {XiaomiElementSearch}
    </div>

}

export default SearchBox;
